import Typography from '@mui/material/Typography';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function App() {

  var people = [
    {
      firstName: "Doug",
      lastName: "Marlin",
      age: 42,

    },
    {
      firstName: "Henry",
      lastName: "Rollins",
      age: 23
    },
    {
      firstName: "Sarah",
      lastName: "Johnson",
      age: 4
    },
    {
      firstName: "Bart",
      lastName: "Rogarts",
      age: 100
    },
    {
      firstName: "Gorno",
      lastName: "Deeker",
      age: 55
    },
  ];

  return (
    <div className="App">
      <Typography variant="h3" gutterBottom>The People</Typography>
        <TableContainer component={Paper}>
          <Table sx={{maxWidth: 400}}>
            <TableHead>
              <TableRow>
                <TableCell>
                  <Typography variant={'overline'}>First Name</Typography>
                </TableCell>
                <TableCell align={'right'}>
                  <Typography variant={'overline'}>Last Name</Typography>
                </TableCell>
                <TableCell align={'right'}>
                  <Typography variant={'overline'}>Age</Typography>
                </TableCell>
              </TableRow>
            </TableHead>
            <TableBody>

            {people.map(function(val, index){
              return (
              <TableRow>
                <TableCell>{val.firstName}</TableCell>
                <TableCell align={'right'}>{val.lastName}</TableCell>
                <TableCell align={'right'}>{val.age}</TableCell>
              </TableRow>
              )})}

            </TableBody>
          </Table>
        </TableContainer>

    </div>
  );
}

export default App;
